package api

import (
	"encoding/base64"
	"testing"

	"github.com/stretchr/testify/require"
)

func TestTryUnmarshal(t *testing.T) {
	tests := []struct {
		name string
		data string
	}{
		{
			name: "V1 mainnet metadata for block 25376581",
			data: "",
		},
		{
			// https://github.com/oasisprotocol/oasis-core/blob/cb10f6284093ac93ba84bde9e43fabdfaf9964af/go/consensus/cometbft/stateless/testdata/block_25300000.json
			name: "V2 metadata for block 25300000",
			data: "",
		},
	}

	for _, test := range tests {
		t.Run(test.name, func(t *testing.T) {
			data, err := base64.StdEncoding.DecodeString(test.data)
			require.NoError(t, err)

			var meta BlockMeta
			err = meta.TryUnmarshal(data)
			require.NoError(t, err, test.name)

			require.NotNil(t, meta.Header, test.name)
			require.NotNil(t, meta.LastCommit, test.name)
		})
	}
}
